  github: https://github.com/primer/octicons
  license: MIT
  license_url: http://opensource.org/licenses/mit-license.php

  css_prefix_text: "icon-"
  columns: 4

font:
  # use !!!small!!! letters a-z, or Opera will fail under OS X
  # fontname will be also used as file name.
  fontname: octicons
  fullname: Octicons
  familyname: Octicons
  copyright: Copyright (C) 2020 by GitHub Inc.
  ascent: 850
  descent: -150
  weight: Normal


